def my_func(input1:str):
    if not (1 <= len(input1) <= 20):
        return ''
    parts = input1.split(' ')
    transformed_parts = []
    for part in parts:
        sub_parts = part.split('-')
        transformed_sub_parts = [sub_parts[0]]
        for sub_part in sub_parts[1:]:
            transformed_sub_parts.append(sub_part.capitalize())
        transformed_parts.append(''.join(transformed_sub_parts))
    return ' '.join(transformed_parts)
